import React from 'react'

const Users = ({users}) => {
  return(
    <div>
      <ul>
        { users && users.map(user => {
          <div key={user.id}>
            <li>
              <span className="username">
                {user.firstName + user.lastName}
              </span>
            </li>
          </div>
        })}
      </ul>
    </div>
  )
}

export default Users
